def getheader_article (OOOOO000O00O000OO ,OO00000OO0O000OO0 ):#line:18:def getheader_article(token, hqaid):
    OO00O00O0O0000O00 =[{"headers":{"Authorization":OOOOO000O00O000OO ,"aid":OO00000OO0O000OO0 ,"platform":"2","o35xzbbp":"qjzsuioa","version":"4.8.5","X-Feature":"sprint3-demo","anonymousId":"d57a9f22d73667b0","timestamp":"1719572761454","nonce":"8d6e927f86344bf698228e678bce63d0714a47cd3bd44b0db52ca2b8ae9ba700","signature":"","tenantId":"03001001","Content-Type":"application/json","Content-Length":"719","Host":"hqapp.faw.cn","Connection":"Keep-Alive","Accept-Encoding":"gzip","User-Agent":"okhttp/3.12.13"},"resDate":{"province":"北京市","city":"北京市","content":"\"卓越的人一大优点是：在不利与艰苦的遭遇里百折不挠最近在挑一台练手车，锁定朗逸（13年左右的）！看了很多车，真的水很深！住的周边是成都最大的二手车市场，有空就去看看！市场那一圈卖车的好多是亲戚，合伙挖坑！几乎都调表，我看上一辆19年的polo，卖车一个劲说原版原漆，无事故，一手，两万公里……喊价5.6w……我打算请个验车师傅过来验车……他说刚刚有人订了……我昨天路过，那车还停在那里（半个月了）……有一家专门卖精品车的，比全新的便宜不了多少~见一小青年，看上​名爵天蝎​​，车商卖给他8.5w……所谓的精品（精修）而已……全靠如何给买主做思想工作……看了一台12年宝来，几乎全身喷漆，发动机水洗，大梁都有焊接……还一个劲忽悠我不是事故车，表显里程9w多，我试了一下换挡吃力……要是买一台2-3万的练手车，不要舍不得那三千块（成都这边找一个挑车师）……自己不懂半懂铁定被宰……举一个实例：朋友的朋友19年通过朋友介绍2.5w买了一台乐风~开得很少……上个月打算2w卖给我，我没有要……他卖给了我附近车商，5000……车商检测后告知：车泡过水……出过重大事故，前嘴，屁股~你们猜老板重新挂牌标价多少？ ","fileString":["https://yxywzt-cms-cos.faw.cn/2024-02-28/6884db21-9c29-4e97-bb3f-4a73084bdcb4.jpg"]}},{"headers":{"Authorization":OOOOO000O00O000OO ,"aid":OO00000OO0O000OO0 ,"platform":"2","o35xzbbp":"qjzsuioa","version":"4.8.5","X-Feature":"sprint3-demo","anonymousId":"d57a9f22d73667b0","timestamp":"1719575241992","nonce":"318e8403a9384b8fbf4acc22e0ad37eee3b790ee1f9e47829df4dfb1e2c1efcd","signature":"","tenantId":"03001001","Content-Type":"application/json","Content-Length":"719","Host":"hqapp.faw.cn","Connection":"Keep-Alive","Accept-Encoding":"gzip","User-Agent":"okhttp/3.12.13"},"resDate":{"province":"北京市","city":"北京市","content":"从生活到生态，智慧亦可相遇，红旗HQ 9已近乎完美，如果改装是一场梦想，那我想，就在车中加装一个生态厕所吧！一定要做到净味净化，瞬间做到无公害处理。庞大的身躯，宽敞的空间，不能缺少一个移动厕所，在长途跋涉中，为驾乘提供更舒适的感受","fileString":["https://yxywzt-cms-cos.faw.cn/2024-02-28/8b2c8863-e8a2-477f-913c-fd2c1f5d25de.jpg"]}},{"headers":{"Authorization":OOOOO000O00O000OO ,"aid":OO00000OO0O000OO0 ,"platform":"2","o35xzbbp":"qjzsuioa","version":"4.8.5","X-Feature":"sprint3-demo","anonymousId":"d57a9f22d73667b0","timestamp":"1719576244885","nonce":"3ae5bc172d794d8b9a413f847c8bc1d06fad00a1fe2b46be8f48eb75acb1120a","signature":"\u003d","tenantId":"03001001","Content-Type":"application/json","Content-Length":"854","Host":"hqapp.faw.cn","Connection":"Keep-Alive","Accept-Encoding":"gzip","User-Agent":"okhttp/3.12.13"},"resDate":{"province":"北京市","city":"北京市","content":"底盘在日常保养的时候最重要的是防锈。车主在对汽车的底盘防锈处理时，应选择专业的汽车美容中心去做。一般来说，做完防锈护理的底盘在高压喷水冲洗后几乎不挂水珠，才可起到很好的防锈保护效果。此外要注意的是，做完防锈护理不要用碱性清洗液，如洗衣粉、洗涤灵冲等洗车身及底盘，会影响防锈效果、缩短防锈时间。底盘防护措施就是底盘装甲，是将一种特殊的弹性胶质材料喷涂在汽车底盘上，将底盘及轮毂上方的噪音部位完全包裹起来，其自然固结后形成的底盘保护层，可以降低沙石撞击的损伤，防腐防锈。","fileString":["https://yxywzt-cms-cos.faw.cn/2024-02-28/fdcbd278-5367-42d4-8bc2-4c1461c86b80.jpg"]}},{"headers":{"Authorization":OOOOO000O00O000OO ,"aid":OO00000OO0O000OO0 ,"platform":"2","o35xzbbp":"qjzsuioa","version":"4.8.5","X-Feature":"sprint3-demo","anonymousId":"d57a9f22d73667b0","timestamp":"1719576212293","nonce":"a3abef48831e4bab92dc474eae6a6acc95bd6851d6834f9891f7700654ad5772","signature":"\u003d","tenantId":"03001001","Content-Type":"application/json","Content-Length":"770","Host":"hqapp.faw.cn","Connection":"Keep-Alive","Accept-Encoding":"gzip","User-Agent":"okhttp/3.12.13"},"resDate":{"province":"北京市","city":"北京市","content":"连岛是江苏最大的岛屿，存在感却很低，除了本地人常去的海滨浴场，其实还有很多小众的机位可以拍摄！来连岛游玩，你可以在海边追波踏浪或是静卧沙滩，也可以沿着拦海巨堤或是海滨栈道临风漫步，当然也可以走进渔村或是海鲜广场品味那鲜香海味，尽享浪漫迷人的海滨风情。早上可以去岛上的海鲜市场，感受海岛特有的人间烟火；中午沿着海岛东路往东，领略集山海石林于一体的独特海岛魅力，尤其连接连云港的堤坝，还有停泊在港口的巨舰，海岛露营","fileString":["https://yxywzt-cms-cos.faw.cn/2024-02-28/b92da4b7-acd4-40de-87e9-868e4c2cf738.jpg"]}},{"headers":{"Authorization":OOOOO000O00O000OO ,"aid":OO00000OO0O000OO0 ,"platform":"2","o35xzbbp":"qjzsuioa","version":"4.8.5","X-Feature":"sprint3-demo","anonymousId":"d57a9f22d73667b0","timestamp":"1719576186427","nonce":"ee6d15b6d22540368465efc78f3d5b9ced53ed655ccd4cd892a2222a38fd270c","signature":"\u003d","tenantId":"03001001","Content-Type":"application/json","Content-Length":"713","Host":"hqapp.faw.cn","Connection":"Keep-Alive","Accept-Encoding":"gzip","User-Agent":"okhttp/3.12.13"},"resDate":{"province":"北京市","city":"北京市","content":"户外游玩是家庭情感交流的一个好平台。现在生活节奏快，工作忙，偶尔有点空，情感培养也越来越匮乏。相约户外游玩主要是以家庭为单位进行组合一起出去游玩的活动，在活动中，一起做游戏，一起交流，一起谈天说地，一起分享美食！不赏奇景，怎知其绝妙。只有亲身实践，身临其境，才有切身体会。唤起我们对大自然的尊重和敬畏，游玩过后，你会发现，生活并不总是乏味，一切都是那么完美，处处充满阳光。","fileString":["https://yxywzt-cms-cos.faw.cn/2024-02-28/d09ff13e-b294-45ed-93dd-654464bcacbb.jpg"]}},{"headers":{"Authorization":OOOOO000O00O000OO ,"aid":OO00000OO0O000OO0 ,"platform":"2","o35xzbbp":"qjzsuioa","version":"4.8.5","X-Feature":"sprint3-demo","anonymousId":"d57a9f22d73667b0","timestamp":"1719576171648","nonce":"c060bf3cc0284b7b87f187c5b281928cbc7f66134f6a499cadcdc39fd4283985","signature":"\u003d","tenantId":"03001001","Content-Type":"application/json","Content-Length":"862","Host":"hqapp.faw.cn","Connection":"Keep-Alive","Accept-Encoding":"gzip","User-Agent":"okhttp/3.12.13"},"resDate":{"province":"北京市","city":"北京市","content":"武隆天生三桥位于武隆县城东南20公里处，天生三硚奇观属典型的喀斯特地貌景观，是全国罕见的地质奇观生态型旅游区，被探险专家和地质专家赞为“地球遗产，世界奇观”。景区位于海拔800米以上的山区，每年约有5 个月的多雨季节，雨雾蒙蒙，日照少，气温低，要选择好出行时间。山上山下温差10度左右，立体气候较显著，适当增减衣物。如果是先去仙女山的话住宿选在仙女山镇最合适，从那里到仙女山景区、天生三桥、梦幻谷和地缝都十分方便，距天生三桥3公里，距仙女山12公里，距梦幻谷16公里，其价格也比在景区内便宜","fileString":["https://yxywzt-cms-cos.faw.cn/2024-02-28/54a34122-67b7-45c9-a124-c6e4165b3cea.jpg"]}},{"headers":{"Authorization":OOOOO000O00O000OO ,"aid":OO00000OO0O000OO0 ,"platform":"2","o35xzbbp":"qjzsuioa","version":"4.8.5","X-Feature":"sprint3-demo","anonymousId":"d57a9f22d73667b0","timestamp":"1719576156868","nonce":"7e7dfcd8711347d48cbd6a0ba53589fde52c1a288e3046b6b499848a719bf3d7","signature":"","tenantId":"03001001","Content-Type":"application/json","Content-Length":"976","Host":"hqapp.faw.cn","Connection":"Keep-Alive","Accept-Encoding":"gzip","User-Agent":"okhttp/3.12.13"},"resDate":{"province":"北京市","city":"北京市","content":"行车记录仪都是有使用温度范围的，一般都会在-10°——60°之间。虽然现在行车记录仪的电池技术已经很先进了，大都采用内聚合物锂电池，所能承受的温度范围也得到了很大的提高，但是行车记录仪也不能长时间在高温下工作的。尤其是在炎热的夏季，车辆在太阳下半小时以上车内温度就可能高达70-80摄氏度，这时如果行车记录仪在车内极易发生安全事故，建议大家最好不要让行车记录仪在高温下持续工作。在安装专车专用行车记录仪时，如果你对车辆的电路不是很熟悉的话，建议在专业人士指导下安装，尤其是在安装走线上。另外，安装固定行车记录仪时一定要保证安装固定到位，以免因固定不到位而发生脱落","fileString":["https://yxywzt-cms-cos.faw.cn/2024-02-28/61243669-2be7-46cb-bae8-042a8c0d83ee.jpg"]}}];#line:201:}];
